export const AudioPlayer = {

    createAudio: () => {
        let audio = new Audio("data:audio/mpeg;base64,");
        audio.loop = true;
        return audio;
    },

    playAlarm: (mute, audio) => {
        if (!mute && audio !== null) {
            let playPromise = audio.play()
            if (playPromise !== undefined) {
                playPromise
                    .then(success => {
                        return success;
                    })
                    .catch(error => {
                        return error;
                    });
            }
        }
    },

    stopAlarm: (audio) => {
        if (audio) {
            audio.pause();
            audio.currentTime = 0;
        }
    }
}